Sentence is withheld and the defendant is placed on probation to DOC for three (3) years.
Conditions of probation:
1) No contact with the victim, Clayton Bunnell, Jr.;
2) Maintain absolute sobriety;
3) Submit to random urine screens and pay for same;
4) AODA assessment and follow through;
5) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
6) Pay court costs;
7) pay supervision fees in an amount to be determined by DOC;
8) provide DNA sample and pay the surcharge;
9) spend six (6) months in the county jail, under the Huber Law, commencing on 09-01-15 at 8:30 a.m.;
10) spend an additional three (3) months in the county jail, under the Huber Law, stayed and to be imposed at the agents discretion and upon order of the court.
11) Pay restitution of $45.00 to Clayton Bunnell, Jr. at 3710 Rasher Street, Manitowoc, WI;
12) Maintain fulltime employment or work search.
